INSERT INTO `movies` VALUES (1,'Romance','Mumbai','2022-10-20 00:00:00.000000','Kakuda',190,'Hindi','kakuda.jpg',' A thrilling blend of horror and comedy, KaKuda explores the mysterious encounters of its characters in a haunted village. Packed with humor, suspense, and unexpected twists, it promises an entertaining ride for fans of supernatural adventures.'),(2,'Drama','Mumbai','2019-06-21 00:00:00.000000','Deadpool & Wolverine',174,'Hindi','deadpool.jpg','A dynamic duo like no other! This action-packed movie combines Deadpool\'s hilarious, irreverent humor with Wolverine\'s fierce, gritty intensity. Expect jaw-dropping fights, witty banter, and a unique blend of chaos and camaraderie as these iconic Marvel characters team up for an unforgettable adventure.'),(3,'Action','Mumbai','2021-08-09 00:00:00.000000','Auron Mein Kahan Dum Tha',141,'Hindi','Auro.jpg','A heartfelt romantic drama that delves into the complexities of love, relationships, and self-discovery. With a captivating narrative and emotional depth, this film promises to resonate with audiences looking for a meaningful cinematic experience.'),(4,'Drama','Mumbai','2022-09-03 00:00:00.000000','Bad Newz',123,'Hindi','Bad Newz.jpg','A gripping crime thriller that delves into the dark underbelly of society, where secrets, betrayal, and unexpected twists keep you on the edge of your seat. Packed with intense performances and a suspenseful storyline, Bad Newz promises an unforgettable ride.'),(5,'Drama','Pune','2023-09-17 00:00:00.000000','Kalki 2928 AD',115,'Hindi','kalki.jpeg','A futuristic sci-fi epic set in the year 2928, Kalki 2928 AD explores the battle between good and evil in a dystopian world. With stunning visuals, mind-bending concepts, and a gripping storyline, this movie takes audiences on a thrilling journey into a high-tech, post-apocalyptic future.'),(6,'Action','Bengaluru','2018-12-21 00:00:00.000000','KGF Chapter 1',156,'Kannada','kgf 1.jpeg','Set in the 1970s, KGF Chapter 1 is an action-packed tale of a young man, Rocky, who rises from poverty to become a powerful figure in the gold mines of Kolar. With intense action, stunning visuals, and a gripping storyline, it introduces audiences to a world of ambition, violence, and a quest for power. The film sets the stage for a larger-than-life saga.'),(7,'Action','Chennai','2015-07-10 00:00:00.000000','Baahubali: The Beginning',159,'Telugu','bahubali 1.jpeg','A grand epic of love, betrayal, and war, Baahubali: The Beginning takes audiences into the majestic kingdom of Mahishmati. With breathtaking visuals, intense battle sequences, and a captivating storyline, it tells the story of two brothers and their struggle for the throne, setting the stage for an unforgettable cinematic journey. The film blends history, mythology, and adventure in an action-packed spectacle.'),(8,'Comedy','Punjab','2020-08-21 00:00:00.000000','Chal Mera Putt 2',114,'Punjabi','chal mera putt2.jpg','A heartwarming comedy-drama that continues the story of a group of Punjabi immigrants in the UK. Chal Mera Putt 2 explores their struggles with identity, friendships, and the pursuit of a better life, all while maintaining humor and emotional depth. With relatable characters and light-hearted moments, this film highlights the challenges and aspirations of the immigrant community.'),(9,'Action','Pune',NULL,'Dhoom',180,'Hindi',NULL,'action');
